def Clock_eventhandler(event_struct):
   target = event_struct.get_target()
   event = event_struct.code
   if event == lv.EVENT.SCREEN_LOAD_START and True:
      upanim_Animation(ui_Clock_Panel_Clock_Panel, 100)
      upanim_Animation(ui_Clock_Label_Clock_Number, 300)
      upanim_Animation(ui_Clock_Small_label_Date, 200)
      scrolldot_Animation(ui_Clock_Scrolldots_Scrolldots, 0)
   if event == lv.EVENT.GESTURE and True and lv.indev_get_act().get_gesture_dir() == lv.DIR.LEFT :
      indev = lv.indev_get_act()
      indev.wait_release()
      ChangeScreen( ui_Call, lv.SCR_LOAD_ANIM.FADE_ON, 10, 0)
   if event == lv.EVENT.GESTURE and True and lv.indev_get_act().get_gesture_dir() == lv.DIR.RIGHT :
      indev = lv.indev_get_act()
      indev.wait_release()
      ChangeScreen( ui_Alarm, lv.SCR_LOAD_ANIM.FADE_ON, 0, 0)
   if event == lv.EVENT.SCREEN_LOAD_START and True:
      hour_Animation(ui_Clock_Image_Hour, 200)
      min_Animation(ui_Clock_Image_Min, 400)
   return

