def Music_Player_eventhandler(event_struct):
   target = event_struct.get_target()
   event = event_struct.code
   if event == lv.EVENT.SCREEN_LOADED and True:
      upanim_Animation(ui_Music_Player_Image_Album, 100)
      upanim_Animation(ui_Music_Player_Small_label_Music_Title, 200)
      upanim_Animation(ui_Music_Player_Small_label_Author, 300)
      upanim_Animation(ui_Music_Player_Panel_Play_btn, 200)
      upanim_Animation(ui_Music_Player_Image_Forward, 300)
      upanim_Animation(ui_Music_Player_Image_Backward, 400)
      scrolldot_Animation(ui_Music_Player_Scrolldots_Scrolldots3, 0)
   if event == lv.EVENT.GESTURE and True and lv.indev_get_act().get_gesture_dir() == lv.DIR.RIGHT :
      indev = lv.indev_get_act()
      indev.wait_release()
      ChangeScreen( ui_Chat, lv.SCR_LOAD_ANIM.FADE_ON, 0, 0)
   if event == lv.EVENT.GESTURE and True and lv.indev_get_act().get_gesture_dir() == lv.DIR.LEFT :
      indev = lv.indev_get_act()
      indev.wait_release()
      ChangeScreen( ui_Weather, lv.SCR_LOAD_ANIM.FADE_ON, 0, 0)
   return

