def Alarm_eventhandler(event_struct):
   target = event_struct.get_target()
   event = event_struct.code
   if event == lv.EVENT.SCREEN_LOADED and True:
      upanim_Animation(ui_Alarm_Small_label_Set_alarm, 100)
      upanim_Animation(ui_Alarm_Alarm_comp_Alarm_Comp, 200)
      upanim_Animation(ui_Alarm_Alarm_comp_Alarm_Comp1, 300)
      upanim_Animation(ui_Alarm_Alarm_comp_Alarm_Comp2, 400)
      upanim_Animation(ui_Alarm_Alarm_comp_Alarm_Comp3, 500)
      scrolldot_Animation(ui_Alarm_Scrolldots_Scrolldots5, 0)
   if event == lv.EVENT.GESTURE and True and lv.indev_get_act().get_gesture_dir() == lv.DIR.RIGHT :
      indev = lv.indev_get_act()
      indev.wait_release()
      ChangeScreen( ui_Weather, lv.SCR_LOAD_ANIM.FADE_ON, 0, 0)
   if event == lv.EVENT.GESTURE and True and lv.indev_get_act().get_gesture_dir() == lv.DIR.LEFT :
      indev = lv.indev_get_act()
      indev.wait_release()
      ChangeScreen( ui_Clock, lv.SCR_LOAD_ANIM.FADE_ON, 0, 0)
   return

